    }

    handleUrgenncy(e, index) {
        console.log('filter change');
    }

    render() {
        return (
            <div>
                <form onSubmit={(e, filtr) => {this.props.listOfNotes(e, "wer")}}>
                    <input type="text" name="city" placeholder="Фильтр"/>
                    <button>Список заметок</button>
                </form>
            </div>
        );
    }
}

export default FormSearch;
